scene.onHitTile(SpriteKind.Player, 9, function (sprite) {
    if (difficulty == 0) {
        sprite.x += -5
        game.splash("Current balance: " + cashAmount)
        moneyinteraction = game.askForString("¨Deposit¨ or ¨withdraw¨ money? Or ¨no¨.")
        if (moneyinteraction == "deposit") {
            BANKaccount += cashAmount
            game.splash("Amount in bank: " + BANKaccount)
            cashAmount = 0
        } else if (moneyinteraction == "withdraw") {
            cashAmount += BANKaccount
            game.splash("Amount taken: " + BANKaccount)
            BANKaccount = 0
        } else if (moneyinteraction == "no") {
            game.splash("ok")
        }
    }
})
function Change_projectile_speed () {
    if (weaponoption < 2 || weaponoption > 2) {
        if (XVELOCITY == 100) {
            XVELOCITY = 0
            YVELOCITY = -100
        } else if (YVELOCITY == -100) {
            XVELOCITY = -100
            YVELOCITY = 0
        } else if (XVELOCITY == -100) {
            XVELOCITY = 0
            YVELOCITY = 100
        } else if (YVELOCITY == 100) {
            XVELOCITY = 100
            YVELOCITY = 0
        }
    } else if (weaponoption == 2) {
        XVELOCITY = XVELOCITY * -1
    }
}
function Projectileshot () {
    Arrays()
    projectile = sprites.createProjectileFromSprite(Available_weapon_sprites[weaponoption], Person, XVELOCITY, YVELOCITY)
    if (weaponoption == 2) {
        projectile.ay = 320
    }
}
